import React from 'react';
import Template from './components/Template';
import Details from './pages/details';


const App = () => {
  return (
    <html dir="rtl" lang="ar" className="font-mons mr-10"  >

    <Template>
      {/* Content goes here */}
      <div className="font-mons">
          <p>            طلب معلومات </p>
        </div>
     <Details/>
    </Template>
    </html>
  );
};

export default App;
